import React, { useRef, useEffect } from 'react';
import "./Swap.module.css";

const Swap = () => {
  const iframeRef = useRef(null);

  useEffect(() => {
    if (iframeRef.current) {
      const iframeDocument = iframeRef.current.contentDocument;
      const someElement = iframeDocument.getElementsByClassName('application');
      someElement.style.display = 'block';
      // add more style manipulations here as needed
    }
  }, []);
  return (
    <iframe
      ref={iframeRef}
      width="400"
      height="690"
      frameborder="0"
      allow="clipboard-read *; clipboard-write *; web-share *; accelerometer *; autoplay *; camera *; gyroscope *; payment *; geolocation *"
      src="https://flooz.trade/embed/trade?swapDisabled=false&swapToTokenAddress=0xdc42c3a92c4A03F9b9F3FBaBa0125286FDAa6772&swapLockToToken=true&onRampDisabled=true&onRampAsDefault=false&onRampDefaultAmount=200&network=bsc&lightMode=false&primaryColor=%23bfc500&roundedCorners=1&padding=20"
    ></iframe>
  );
};

export default Swap;
